import React, { useEffect, useState } from "react";
import { useParams } from 'react-router-dom'



const UserDetail = () => {
    const [subsData, setSubsData] = useState([]);
    const { id } = useParams();
    console.log(id);
    const getuserDetail = async () => {
        try {
            const response = await fetch(`http://localhost:3000/users/${id}`,{
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            });
            console.log(response);
            const data = await response.json();
            setSubsData(data)
        }
        catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getuserDetail();
    });
    return (
        <div className='content-wrapper'>
            <div className="container content user_detail">
                <div className='card col-md-6'>
                    <div className="card-header">
                        <div className="card-title mb-0">
                            <span className="content-header">User Name</span>
                        </div>
                    </div>
                    <div className='plan-detail pt-3'>
                        <div key={subsData.id}>
                        <div className="col-md-3">
                                <h6><strong>Name</strong> : </h6>
                                <h6><strong>Name</strong></h6>
                                <h6><strong>Email</strong> : {subsData.email}</h6>
                        </div>
                        <div className="col-md-9">
                                <h6>{subsData.first_name + " " + subsData.middle_name + " " + subsData.last_name}</h6>
                        </div>
                            <h6><strong>Name</strong> : {subsData.first_name + " " + subsData.middle_name + " " + subsData.last_name}</h6>
                            <h6><strong>User Name</strong> : {subsData.username}</h6>
                            <h6><strong>Email</strong> : {subsData.email}</h6>
                            <h6><strong>Password</strong> : {subsData.password}</h6>
                            <h6><strong>Address</strong> : {subsData.address}</h6>
                            <h6><strong>Country</strong> : {subsData.country}</h6>
                            <h6><strong>Join Date</strong> : {subsData.join_date}</h6>
                        </div>


                    </div>
                </div>
            </div>
        </div>
    )
}

export default UserDetail;
